import "./TopBar.css"

export default function TopBar() {
    const user = true;
    return (
        <div className="top">
            <div className="topleft"><Link to="/">Blogs<sup>specialists</sup></Link></div>
            <div className="topcenter">Username</div>
            <div className="topright">Log out</div>
        </div>
    )
}
